const songs = [
  { title:"Lag Ja Gale", artist:"Lata Mangeshkar", src:"",img:"data:image/jpeg;base64,", duration:"3:43" },
  { title:"Zamana Lage", artist:"Unknown", src:"", img:"data:image/jpeg;base64,", duration:"4:05" },
  { title:"Banjara", artist:"Mohit Chauhan", src:"", img:"data:image/jpeg;base64,", duration:"4:01" },
  { title:"Humnava", artist:"KK / Adnan Sami", src:"", img:"data:image/jpeg;base64,", duration:"3:55" },
  { title:"Bewajah", artist:"Atif Aslam", src:"", img:"data:image/jpeg;base64,", duration:"4:10" },
  { title:"Nazara", artist:"Unknown", src:"", img:"data:image/jpeg;base64,", duration:"3:50" },
  { title:"Ishq Bulaava", artist:"Atif Aslam", src:"", img:"data:image/jpeg;base64,", duration:"4:12" },
  { title:"Tujhse Naraz Nahi Zindagi", artist:"Lata Mangeshkar", src:"", img:"data:image/jpeg;base64,", duration:"3:40" },
  { title:"Metro… In Dino", artist:"Atif Aslam", src:"", img:"data:image/jpeg;base64,", duration:"4:15" },
  { title:"Saiyaara", artist:"Arijit Singh", src:"", img:"data:image/jpeg;base64,", duration:"4:20" }
];

const songListEl = document.getElementById('songList');
const audio = new Audio('path/to/song.mp3'); // Replace with your song source
const progressContainer = document.getElementById('progressContainer');
const progress = document.getElementById('progress');
const navButtons = document.querySelectorAll('.nav-btn');
const pages = document.querySelectorAll('.page');

navButtons.forEach(btn => {
  btn.addEventListener('click', () => {
    const targetId = btn.getAttribute('data-page');

    // Hide all sections
    pages.forEach(page => {
      page.classList.remove('active');
    });

    // Show selected section
    document.getElementById(targetId).classList.add('active');
  });
});



// Update progress bar as song plays
audio.addEventListener('timeupdate', () => {
  if(audio.duration) {
    const percent = (audio.currentTime / audio.duration) * 100;
    progress.style.width = percent + '%';
  }
});

// Seek when user clicks on progress bar
progressContainer.addEventListener('click', (e) => {
  const width = progressContainer.clientWidth;
  const clickX = e.offsetX;
  const duration = audio.duration;

  audio.currentTime = (clickX / width) * duration;
});

// Example to play the audio (replace with your play button logic)
audio.play();

let currentIndex = 0, isPlaying = false, listPlayingIndex = null;

// Render song items
songs.forEach((song, i) => {
  const li = document.createElement('li');
  li.className = 'song-item';
  li.dataset.index = i;
  li.innerHTML = `
    <img src="${song.img}" class="cover">
    <div class="song-info"><div class="title">${song.title}</div><div class="artist">${song.artist}</div></div>
    <div class="timestamp"><span class="current">0:00</span> / <span class="duration">${song.duration}</span></div>
    <button class="song-play-pause"><img src="https://img.icons8.com/ios-filled/20/000000/play--v1.png"/></button>
  `;
  songListEl.appendChild(li);
});

function updateUI() {
  document.querySelectorAll('.song-item').forEach(el => el.classList.remove('playing'));
  if (listPlayingIndex !== null) {
    songListEl.children[listPlayingIndex].classList.add('playing');
  }
  document.querySelectorAll('.song-play-pause img').forEach((img,i) => {
    img.src = (i===listPlayingIndex && isPlaying)
      ? "https://img.icons8.com/ios-filled/20/000000/pause--v1.png"
      : "https://img.icons8.com/ios-filled/20/000000/play--v1.png";
  });
  document.getElementById('playPauseIcon').src = isPlaying
    ? "https://img.icons8.com/ios-filled/24/ffffff/pause--v1.png"
    : "https://img.icons8.com/ios-filled/24/ffffff/play--v1.png";
}

function loadSong(i) {
  audio.src = songs[i].src;
  currentIndex = i; listPlayingIndex = i;
  const ts = songListEl.children[i].querySelector('.timestamp .current');
  ts.textContent = '0:00';
  updateUI();
}

function playSong() { audio.play(); isPlaying = true; updateUI(); }
function pauseSong() { audio.pause(); isPlaying = false; updateUI(); }

document.getElementById('playPauseBtn').onclick = () =>
  isPlaying ? pauseSong() : playSong();

document.getElementById('prevBtn').onclick = () => {
  currentIndex = (currentIndex - 1 + songs.length) % songs.length;
  loadSong(currentIndex); playSong();
};

document.getElementById('nextBtn').onclick = () => {
  currentIndex = (currentIndex + 1) % songs.length;
  loadSong(currentIndex); playSong();
};

audio.ontimeupdate = () => {
  const pct = (audio.currentTime / audio.duration) * 100;
  document.getElementById('progress').style.width = pct + '%';
  if (listPlayingIndex !== null) {
    const ts = songListEl.children[listPlayingIndex].querySelector('.timestamp .current');
    ts.textContent = formatTime(audio.currentTime);
  }
};

document.getElementById('progressContainer').onclick = e => {
  audio.currentTime = (e.offsetX / e.currentTarget.clientWidth) * audio.duration;
};

songListEl.onclick = e => {
  const btn = e.target.closest('.song-play-pause');
  if (!btn) return;
  const idx = +btn.closest('.song-item').dataset.index;
  if (idx === currentIndex) isPlaying ? pauseSong() : playSong();
  else { loadSong(idx); playSong(); }
};

audio.onended = () => {
  currentIndex = (currentIndex + 1) % songs.length;
  loadSong(currentIndex); playSong();
};

function formatTime(sec) {
  const m = Math.floor(sec/60), s = Math.floor(sec%60).toString().padStart(2,'0');
  return `${m}:${s}`;
}

// Initialize with first song
loadSong(0);


